response.about:
Три вещи ни когда не возвратятсяобратно: время, слово,возможность;
Тир вещи не следует терять: спокойствие, надежду и честь;
Три вещи наиболее ценны: любовь, убеждения, дружба;
Три вещи в жизни никогда не надежны: мечты,удача, состояние;
Три вещи определяют человека: труд честность, достижения;
Три вещи разрушают человека: вино, гордыня, злость и ПЛЮШКИ
